import React from "react";
import "./Header.css";

const Header = ({ isAuthenticated, onLogout }) => {
  return (
    <header className="header">
      <h1>TickTask</h1>
      {isAuthenticated && <button onClick={onLogout}>Logout</button>}
    </header>
  );
};

export default Header;
